column21:
comment:"Overall very good experience. It was my second order from draz. Draz never disappoints to its clients. Actually i won a draz voucher of 3000 in a competition and that's why i ordered. But now I'm impressed and will order again very soon.  

Parcel Reviews:
Parcel bohat achy se packed tha. Kahi se b breakage nhi thi. Thora sa late hogya ku k eid se pehly order kiya tha. But it's negligible. Draz is trusted app. and last but not least Dawlance reliable hai ;)"}
